Gold to Belarus 🇧🇾 

@mattyletsgetit delivers the goods in Nairobi and wins the men’s pole vault title with a clearance of 5.45m💪

#Athletics #TrackAndField #PoleVault #Nairobi #WorldAthleticsU20

Jamaica to the world 🇯🇲🌍 

@tina_clayton1 continues Jamaica’s sprinting tradition at @wau20nairobi21 as she keeps the women’s 100m title in Jamaica, winning in 11.09 PB🔥

#Athletics #WorldAthleticsU20 #TrackAndField #Nairobi #Track #Jamaica

No better place to produce a personal best than on the biggest stage of your career 💪

@vilagos_adriana smashes per PB to throw a world U20 leading 61.46m to win the women’s javelin🤯

#WorldAthleticsU20 #Athletics #TrackAndField #Track
